import React, { useState, useEffect } from 'react';
import { useWeb3 } from '../context/Web3Context';
import { Line } from 'react-chartjs-2';
import {
    Chart as ChartJS,
    CategoryScale,
    LinearScale,
    PointElement,
    LineElement,
    Title,
    Tooltip,
    Legend
} from 'chart.js';
import '../styles/PriceChart.css';

ChartJS.register(
    CategoryScale,
    LinearScale,
    PointElement,
    LineElement,
    Title,
    Tooltip,
    Legend
);

const PriceChart = () => {
    const { ethPrice, refreshData } = useWeb3();
    const [priceHistory, setPriceHistory] = useState([]);
    const [timeLabels, setTimeLabels] = useState([]);

    // Simulate price data fetching
    const updatePriceData = () => {
        // Update price history
        setPriceHistory(prev => {
            const newHistory = [...prev, parseFloat(ethPrice)];
            return newHistory.slice(-20); // Keep last 20 data points
        });

        // Update time labels
        setTimeLabels(prev => {
            const now = new Date().toLocaleTimeString([], { hour: '2-digit', minute: '2-digit' });
            const newLabels = [...prev, now];
            return newLabels.slice(-20);
        });
    };

    useEffect(() => {
        // Initial update
        updatePriceData();

        // Set up interval for regular updates
        const interval = setInterval(() => {
            refreshData(); // This will update ethPrice in the context
            updatePriceData();
        }, 5000); // Update every 5 seconds

        return () => clearInterval(interval);
    }, [ethPrice]);

    const chartData = {
        labels: timeLabels,
        datasets: [
            {
                label: 'ETH/USD Price',
                data: priceHistory,
                borderColor: '#3498db',
                backgroundColor: 'rgba(52, 152, 219, 0.1)',
                borderWidth: 2,
                pointBackgroundColor: '#3498db',
                pointRadius: 3,
                tension: 0.2,
                fill: true
            }
        ]
    };

    const chartOptions = {
        responsive: true,
        maintainAspectRatio: false,
        plugins: {
            legend: {
                position: 'top',
                labels: {
                    color: '#ecf0f1',
                    font: {
                        size: 12
                    }
                }
            },
            title: {
                display: true,
                text: 'ETH Price History',
                color: '#ecf0f1',
                font: {
                    size: 16,
                    weight: 'bold'
                }
            },
            tooltip: {
                mode: 'index',
                intersect: false,
                backgroundColor: 'rgba(44, 62, 80, 0.9)',
                titleColor: '#ecf0f1',
                bodyColor: '#ecf0f1',
                borderColor: '#3498db',
                borderWidth: 1
            }
        },
        scales: {
            y: {
                beginAtZero: false,
                grid: {
                    color: 'rgba(255, 255, 255, 0.1)'
                },
                ticks: {
                    color: '#ecf0f1',
                    callback: function(value) {
                        return '$' + value;
                    }
                }
            },
            x: {
                grid: {
                    color: 'rgba(255, 255, 255, 0.1)'
                },
                ticks: {
                    color: '#ecf0f1'
                }
            }
        },
        interaction: {
            mode: 'nearest',
            axis: 'x',
            intersect: false
        },
        animation: {
            duration: 1000
        }
    };

    return (
        <div className="price-chart-container">
            <div className="price-header">
                <h2>ETH/USD Price</h2>
                <div className="current-price-display">
                    <span className="price-label">Current:</span>
                    <span className="price-value">${parseFloat(ethPrice).toFixed(2)}</span>
                </div>
            </div>
            <div className="chart-container">
                <Line data={chartData} options={chartOptions} />
            </div>
            <div className="price-info">
                <div className="price-stat">
                    <span className="stat-label">24h Change:</span>
                    <span className="stat-value positive">+2.34%</span>
                </div>
                <div className="price-stat">
                    <span className="stat-label">24h High:</span>
                    <span className="stat-value">${(parseFloat(ethPrice) * 1.05).toFixed(2)}</span>
                </div>
                <div className="price-stat">
                    <span className="stat-label">24h Low:</span>
                    <span className="stat-value">${(parseFloat(ethPrice) * 0.95).toFixed(2)}</span>
                </div>
            </div>
        </div>
    );
};

export default PriceChart;
